import React, { Component } from 'react';
import './'

class Search extends Component {
    constructor(props) {
        super(props)
        this.state = {
            search: '',
        }
    }

    handleKey = (e) => {
        if(e.key === 'Enter') {
            this.props.searchMovie(this.state.search)
        }
    } 

    render() {
        return (
            <nav>
                <div className="nav-wrapper grey darken-4">
                        <div className="input-field">
                            <input 
                                id="search" 
                                type="search"
                                onChange={(e) => this.setState({
                                    search: e.target.value, 
                                })}
                                onKeyDown={this.handleKey} 
                                required 
                            />
                            <label className="label-icon" htmlFor="search"><i onClick={this.props.searchMovie.bind(this, this.state.search)} className="material-icons search-movie">search</i></label>
                            <i className="material-icons">close</i>
                        </div>
                </div>
            </nav>
        )
    }
}

export { Search }
